import React from "react";
import KnobDescribed from "./../../../../common/KnobDescribed/KnobDescribed";
import {toDbValueText} from "./../../../../../../../utils/sound/converter"
import "./eq-knob.scss";


const EqKnob = props =>{

    return (
        <KnobDescribed className={"eq-knob " + props.className}
            showValue 
            unsymetric={{positive:4}} 
            scala={50}
            alt={props.alt}
            quantize={{negative: 1, positive:0.1}} 
            onChange={ props.onChange }
            dobuleClickInit/>
    )
}

export default EqKnob;
